generated.css:
.tech {
    display: grid;
    grid-template-columns: auto auto auto auto;
    justify-items: center;
    margin-bottom: 120px;
}

.tech__image {
    height: 200px;
    width: auto;
    border-style: solid;
    border-radius: 600px;
    border-width: 10px;
    border-color: white;
    box-shadow: 0 10px 20px rgba(0, 0, 0, 0.19), 0 6px 6px rgba(0, 0, 0, 0.23);
}

.tech__title {
    width: 100vw;
    text-align: center;
    font-size: 50px;
    margin-bottom: 90px;
    font-family: 'Trebuchet MS', 'Lucida Sans Unicode', 'Lucida Grande', 'Lucida Sans', Arial, sans-serif;
    color: white;
}
